import axios from 'axios';
import React, { useState } from 'react'

function AddCar() {


    const [CarData, setCarData] = useState({
    baslik: '',
    marka: '',
    vites: '',
    renk: '',
    fiyat: '',
    });

  const handleChange = (e) =>{
    setCarData({
      ...CarData,
      [e.target.name]: e.target.value
    });
    console.log(CarData);
  }

  const handleSubmit = (e) =>{
    e.preventDefault();
    
    const res = axios.post("http://127.0.0.1:8000/api/cars/insert", CarData).then((response) =>{
      console.log(response.data.data);
      console.log(response.message);
    })
  }
  
  


  return (
    <div style={{minHeight:"88vh"}}>
      <div className="container">
        <form action="">
          <div className="row mt-3">
            <div className="col-6">
              <label className='form-label'>İlan Başlığı</label>
              <input type="text" className="form-control" onChange={handleChange} name='baslik' />
            </div>

            <div className="col-6">
            <label className='form-label'>Marka</label>
              <input type="text" className="form-control" onChange={handleChange} name='marka' />
            </div>
          </div>

          <div className="row">
          <div className="col-6">
            <label className='form-label'>Vites</label>
              <select 
              name="vites" 
              className="form-select"
              value={CarData.vites}
              onChange={handleChange}
              >
                <option value="Manuel">Manuel</option>
                <option value="Yarı Otomatik">Yarı Otomatik</option>
                <option value="Otomatik">Otomatik</option>
              </select>
            </div>

            <div className="col-3">
              <label className='form-label'>Renk</label>
              <input type="text" className="form-control" onChange={handleChange} name='renk' />
            </div>

            <div className="col-3">
              <label className='form-label'>Yıl</label>
              <input type="text" className="form-control" onChange={handleChange} name='yil' />
            </div>
          </div>

          <div className="row mt-3">
            <div className="col-12">
              <button className='btn btn-success' type='submit'>Kaydet</button>
            </div>
          </div>
        </form>
      </div>
    </div>
  )
}

export default AddCar
